function shouldAutoPlay() {
	return $('#AutoPlay').is(':checked');
}

function loadAudio() {
	var $audio = $('#Audio4');
	$audio.attr('src', 'data:audio/mpeg;base64,');
//	$audio[0].pause();
	if (shouldAutoPlay()) {
		$audio[0].play();
	}
}

function loadAudioNumber() {
	var $select = $('#NumberSelect');
	var selected = $select.find('option:selected').val();
	if (selected === '-') {
		return;	// This means nothing selected
	}
	var $audio = $('#AudioNumbers');
	$audio.attr('src', 'sources/number-' + selected + '.m4a');
	if (shouldAutoPlay()) {
		$audio[0].play();
	}
}

